import React from 'react';

const Monster = () => (
  <svg width="64" height="64" viewBox="0 0 8 8">
    <rect x="2" y="1" width="4" height="5" fill="#8B4513" />
    <rect x="1" y="2" width="1" height="3" fill="#8B4513" />
    <rect x="6" y="2" width="1" height="3" fill="#8B4513" />
    <rect x="3" y="6" width="1" height="1" fill="#8B4513" />
    <rect x="5" y="6" width="1" height="1" fill="#8B4513" />
    <rect x="3" y="2" width="1" height="1" fill="#FFF" />
    <rect x="5" y="2" width="1" height="1" fill="#FFF" />
    <rect x="3" y="4" width="3" height="1" fill="#FF0000" />
  </svg>
);

export default Monster;
